import React from "react";
import "./Contact.css";

const Contact = () => {
  return (
    <div className="Contact">
      <head>
        <title>icon</title>
          <link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.css" target="_blank" rel="noopener noreferrer" rel="stylesheet"></link>
      </head>
      <body>
        <ul>
          <li><a href="https://www.linkedin.com/in/emily-ann-garner/"><i class="fa fa-linkedin" aria-hidden="true"></i></a></li>
          <li><a href=""><i class="fa fa-github" aria-hidden="true"></i></a></li>
          </ul>
      </body>
    </div>
  );
};
export default Contact;
